  input: "TEXT\x1CC00111278\x1CTEXT.1\x1C\x1CF3XA\x1CThe Schedule B telemarketing
    expense was for NRTL PAC fundraising only and in no way benefitted any candidate
    directly.  We have clarified the description on the report. These transactions
    were entered into the database but they were coded incorrectly, thus did not get
    compiled into the original report.   We caught this error when preparing the amended
    report so that they were reported on the amended report.Each debt transaction
    requires a separate linking ID in order for the transactions to report properly;
    however, the same ID was used and all transactions with that ID aggregated to
    the first candidate with that ID for each vendor.  Again, when the appropriate
    changes were made in the data entry to provide discrete ID numbers, the proper
    amounts and the correct candidates were disclosed.Due to an error in linking actual
    payments with estimates, some of our debts were not originally reported has having
    been extinguished at the end of 2006.  When cleaning up the data entry and linking
    them properly, these debts were actually paid in 2006 and reported on our amended
    2006 reports.  Thus, they would not appear on the 2007 Mid Year report.\x1C"
